import React from 'react'
import styles from "./pictures.module.css"

const Pictures = () => {
    return (
        <div className={styles.outer__div}>
        
          <div>
              <img src="https://i.postimg.cc/KcnyvGC0/ME.jpg" alt="prop"/>
          </div>
        </div>
    )
}

export default Pictures
